/**
 * @param {string} s
 * @return {number}
 */
var numSub = function (s) {
    var len = s.length;
    var subStr = '';
    var sum = 0;
    // var sets = new Set();
    for (var i = 0; i < len; i++) {
        if (s[i] === '0' && subStr.length > 0) {
            sum += getSums(subStr.length);
            // sets.add(subStr)
            subStr = '';
        } else if (s[i] === '1') {
            subStr = subStr + s[i];
        }
    }
    if (subStr.length !== 0) {
        sum += getSums(subStr.length);
        // sets.add(subStr)
    }
    // for(let subStr of sets){
    //     sum+=getSums(subStr.length);
    // }
    return sum;
};

var getSums = function (n) {
    if (n < 1) return 0;
    var sum = 0;
    for (var i = 0; i <= n; i++) {
        sum += i;
    }
    return sum;
}


